(1, 60, 'Duis sed odio sit amet nibh vulputate cursus', 'java-article-1', '<h3><strong><img src="images/joomlavi/blog1.jpg" alt="" width="744" height="302" /></strong></h3>\r\n<p>Proin gravida nibh vel velit auctor aliquet. Aenean sollicitudin, lorem quis bibendum auctor, nisi elit consequat ipsum, nec sagittis sem nibh id elit. Duis sed odio sit amet nibh vulputate cursus a sit amet mauris. Morbi accumsan ipsum velit. Nam nec tellus a odio tincidunt auctor a ornare odio. Sed non mauris vitae erat consequat auctor eu in elit. Class aptent taciti sociosqu ad litora torquent per conubia nostra, per inceptos himenaeos.</p>\r\n', '\r\n<p> </p>\r\n<h3><strong>Objectives:</strong></h3>\r\n<ul>\r\n<li>How to add a navigation drawer to you app?</li>\r\n<li>How to populate the drawer list?</li>\r\n<li>How to open the drawer by clicking on the app icon “top-left icon”?</li>\r\n<li>How to handle click events?</li>\r\n</ul>', 1, 8, '2014-05-22 16:00:56', 262, '', '2014-05-23 04:13:32', 262, 0, '0000-00-00 00:00:00', '2014-05-22 16:00:56', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 5, 5, '', '', 1, 12, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(2, 61, 'Android article one', 'android-article-one', '<p><strong>Android article one:</strong></p>\r\n<p>Android volley is a networking library was introduced to make networking calls much easier, faster without writing tons of code. By default all the volley network calls works asynchronously, so we don’t have to worry about using asynctask anymore.</p>\r\n<p>Volley comes with lot of features. Some of them are</p>\r\n<p>1. Request queuing and prioritization<br /> 2. Effective request cache and memory management<br /> 3. Extensibility and customization of the library to our needs</p>', '', 1, 9, '2014-05-22 16:02:38', 262, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2014-05-22 16:02:38', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 1, 0, '', '', 1, 10, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(3, 62, 'Cordova Article 1', 'cordova-article-1', '<p><strong>Cordova Article 1:</strong></p>\r\n<p>Before developing for any of the platforms listed below, install cordova''s command-line interface (CLI). (For details, see <a href="http://cordova.apache.org/docs/en/3.4.0/guide_cli_index.md.html#The%20Command-Line%20Interface">The Command-Line Interface</a>.)</p>\r\n<p>To develop Cordova applications, you must install SDKs for each mobile platform you are targeting. This installation is necessary regardless of whether you do the majority of your work in the SDK or use the CLI for your build cycle.</p>\r\n<p>Each <em>Platform Guide</em> listed below tells you what you need to know to set up each platform''s development environment: where to obtain the SDK, how to set up device emulators, how to connect devices for direct testing, and how to manage signing key requirements. Additional guides provide information on each platform''s unique set of configuration options, instructions to add plugins, how to upgrade each platform, and platform-specific command-line tools that serve as a lower-level alternative to the <code>cordova</code> command-line utility.</p>', '', 1, 10, '2014-05-22 16:04:04', 262, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2014-05-22 16:04:04', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 1, 0, '', '', 1, 3, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(4, 63, 'Phone Article 1', 'phone-article-1', '<p><strong>Phone Article 1:</strong></p>\r\n<p>Easily create apps using the web technologies you know and love: HTML, CSS and JavaScript</p>\r\n<p>PhoneGap is a free and open source framework that allows you to create mobile apps using standardized web APIs for the platforms you care about.</p>\r\n<p>From first-timers to long-time veterans, we’ve got your dev needs covered. The developer portal is the place to find guides, documentation and tutorials.</p>', '', 1, 11, '2014-05-22 16:06:47', 262, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2014-05-22 16:06:47', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 1, 0, '', '', 1, 6, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(5, 64, 'Sencha Article 1', 'sencha-article-1', '<h2><strong>Sencha Article 1:</strong></h2>\r\n<h2 id="getting_started-section-what-is-sencha-touch%3F"><strong>What is Sencha Touch?</strong></h2>\r\n<p>Sencha Touch is a high-performance HTML5 mobile application framework. You can use Sencha Touch to produce a native-app-like experience inside a browser or in a hybrid shell. Sencha Touch supports Android, iOS, Windows Phone, Microsoft Surface Pro and RT, and BlackBerry devices.</p>\r\n<h2 id="getting_started-section-required-software">Required Software</h2>\r\n<ol>\r\n<li>Download and unzip <a href="http://www.sencha.com/products/touch/download">Sencha Touch</a>. You can unzip the software to any directory.</li>\r\n<li>Sencha Touch requires <a href="http://www.google.com/chrome">Chrome</a> or <a href="http://www.apple.com/safari">Safari</a>. On a mobile device, you can use Chrome, Safari, or Internet Explorer 10 or 11.</li>\r\n<li><a href="http://www.sencha.com/products/sencha-cmd/download">Sencha Cmd</a>.<br /> Sencha Touch 2.3.1 requires Sencha Cmd 4.0.1, 4.0.2, or later. To check that you have correctly installed Sencha Cmd, type the <code>sencha</code> command, for example:\r\n<pre id="ext-gen1381" class="notpretty">$ sencha\r\nSencha Cmd vn.n.n\r\n...\r\n</pre>\r\n</li>\r\n</ol>', '', 1, 12, '2014-05-22 16:08:03', 262, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2014-05-22 16:08:03', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_