(6, 65, 'PHP article 1', 'php-article-1', '<p> </p>\r\n<p><strong>PHP Development article 1:</strong></p>\r\n<p>The PHP development team announces the immediate availability of PHP 5.6.0beta3. As we entered the feature freeze with beta1, this is is a bugfix-only release. All users of PHP are encouraged to test this version carefully, and report any bugs in <a href="https://bugs.php.net">the bug tracking system</a>.</p>\r\n<p><strong>THIS IS A DEVELOPMENT PREVIEW - DO NOT USE IT IN PRODUCTION!</strong></p>\r\n<p>For more information about the new features you can check out the work-in-progress <a href="http://docs.php.net/manual/en/migration56.new-features.php">documentation</a> or you can read the full list of changes in the <a href="https://github.com/php/php-src/blob/php-5.6.0beta3/NEWS">NEWS file</a> contained in the release archive.</p>', '', 1, 13, '2014-05-22 16:10:17', 262, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2014-05-22 16:10:17', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 1, 0, '', '', 1, 16, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
